import React from "react";

export default function FreelancerDetail() {
  return (
    <div
      style={{ backgroundColor: "#171717", width: "100vw", height: "100vh" }}
    >
      <div
        className="details-top"
        style={{
          display: "flex",
          justifyContent: "space-around",
          alignItems: "center",
          padding: "80px 50px 0 50px",
        }}
      >
        <div className="freelancer-name" style={{}}>
          <h4 style={{ color: "#fff", fontSize: "48px", fontWeight: "700" }}>
            Hi , I am
          </h4>
          <h4 style={{ color: "#fff", fontSize: "48px", fontWeight: "700" }}>
            Freelancer Name
          </h4>
        </div>
        <div className="freelancer-photo">
          <img
            src="https://wallpapercosmos.com/w/full/9/9/c/409473-3840x2160-desktop-4k-jason-statham-background-image.jpg"
            alt="#"
            width={"600px"}
            height={"600px"}
            style={{
              borderRadius: "100%",
              borderWidth: "1px",
              borderColor: "#202020",
              borderStyle: "solid",
              padding: "30px",
              maxWidth: "100%",
              maxHeight: "100%",
              objectFit: "cover",
            }}
          />
        </div>
      </div>
    </div>
  );
}
